import React from "react";
import "./style.css"

function buttonClicked(){
    console.log("Clicked");
}

function App() {
  return (
    <div className="container">
      <h1>Hello</h1>
      <input type="text" placeholder="What's your name?" />
      <button onClick={buttonClicked}>Submit</button>
    </div>
  );
}

export default App;
